import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import ListaChamados from './components/ListaChamados';
import IncluirChamado from './components/IncluirChamado';
import ConsultarChamado from './components/ConsultarChamado';

function App() {
  return (
    <Router>
      <div>
        <Routes>
        <Route path="/" element={<Login />} />
          <Route path="/login" element={<Login />} />
          <Route path="/chamados" element={<ListaChamados />} />
          <Route path="/chamados/incluir" element={<IncluirChamado />} />
          <Route path="/chamados/:id" element={<ConsultarChamado />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
